import React, {Fragment} from "react";
import styled from "styled-components";
import "bootstrap/dist/css/bootstrap.min.css";
import Container from "react-bootstrap/Container"
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import infopic1 from "../img/infopic1.jpg"
import infopic2 from "../img/infopic2.jpg"
import infopic3 from "../img/infopic3.jpg"

const Infographic = () => {
  return (
<Fragment> 
<Container fluid style={{backgroundColor:'white'}}> 


<Row className="justify-content-md-center" style={{justifyContent:"center"}}>
    <Col> </Col>
    <Col> 
    <Row className="d-flex justify-content-center center-block d-block m-auto"> <img src={infopic1} alt="Logo" className="infopic1" /></Row>
    <Row className="d-flex justify-content-center center-block d-block m-auto"><h2>Fly Safe</h2></Row>
    <Row className="d-flex justify-content-center center-block d-block m-auto" style={{padding:"1em"}}> <p> Through collaborations with airlines around the world, TravelBuddy offers you the best price across millions of flights to create your perfect trip</p></Row>

    </Col>

    <Col> 
    <Row className="d-flex justify-content-center center-block d-block m-auto"> <img src={infopic2} alt="Logo" className="infopic1" /></Row>
    <Row className="d-flex justify-content-center center-block d-block m-auto"><h2>Recuperate Well</h2></Row>
    <Row className="d-flex justify-content-center center-block d-block m-auto" style={{padding:"1em"}}> <p> Through collaborations with airlines around the world, TravelBuddy offers you the best price across millions of flights to create your perfect trip</p></Row>

    </Col>

    <Col> 
    <Row className="d-flex justify-content-center center-block d-block m-auto"> <img src={infopic3} alt="Logo" className="infopic1" /></Row>
    <Row className="d-flex justify-content-center center-block d-block m-auto"><h2>Bundled Deals</h2></Row>
    <Row className="d-flex justify-content-center center-block d-block m-auto" style={{padding:"1em"}}> <p> Through collaborations with airlines around the world, TravelBuddy offers you the best price across millions of flights to create your perfect trip</p></Row>

    </Col>
    <Col> </Col>


  </Row>

</Container> 
</Fragment> 
  );
};

export default Infographic;
